import ExpenseItem from "./components/ExpenseItem";

function App() {
    const expense = [
        {id: 'e04', title:'Car Insurance' , amount: 296.23 , date : new Date(2022, 10 , 11),},
        {id: 'e03', title:'Cinema' , amount: 36.40 , date : new Date(2022, 10 , 10),},
        {id: 'e02', title:'Netflix monthly' , amount: 8.90 , date : new Date(2022, 10 , 1),},
        {id: 'e01', title:'Restaurant' , amount: 70.43 , date : new Date(2022, 10 , 9),},
    ]
  return (
    <div>
        <h2>Let's get started!</h2>
        <ExpenseItem
            amount={expense[0].amount}
            title={expense[0].title}
            date={expense[0].date}
        />
    </div>
  );
}

export default App;
